import React from "react";
import ExpenseItem from "./ExpenseItem";
import "./Expenses.css"
import Card from "../UI/Card";
import ExpensesFilter from "./ExpensesFilter";

//function Expenses (props) { //props.expenses배열을 갖게됨.
const Expenses = (props) => {
    //필터를 출력을 담당하는 함수를 만들자
    //이 함수를 ExpenseFilter에 props로 내려줘야 하니까 Expenses에 ExpensesFilter를 넣고
    //props로 내려줘애겟죠
    
    const yearSeleter = (year) => {
        console.log("In Expenses.js");
        console.log(year);
      };

    return (
        <Card className="expenses">
            <ExpensesFilter seletedYear={yearSeleter} />
            //seletedYear : 함수를 담아주는 변수명
            <div>
                <ExpenseItem 
                    title={props.expenses[0].title}
                    amount={props.expenses[0].amount}
                    date={props.expenses[0].date}
                />
            </div>
            <div>
                <ExpenseItem 
                    title={props.expenses[1].title}
                    amount={props.expenses[1].amount}
                    date={props.expenses[1].date}
                />
            </div>
            <div>
                <ExpenseItem 
                    title={props.expenses[2].title}
                    amount={props.expenses[2].amount}
                    date={props.expenses[2].date}
                />
            </div>
            <div>
                <ExpenseItem 
                    title={props.expenses[3].title}
                    amount={props.expenses[3].amount}
                    date={props.expenses[3].date}
                />
            </div>
      </Card>
    );
};

export default Expenses;
